import{_ as r}from"./chunks/toolbox_icon.Bz2Hj-K_.js";import{_ as o,a as i,b as l}from"./chunks/info_icon.B0mCpcie.js";import{_ as t}from"./chunks/go_to_line_icon.DnbrMUu9.js";import{_ as p}from"./chunks/toolbox_profiler.CSqkfwpe.js";import{_ as s}from"./chunks/start_profiling_icon.BJO98GJM.js";import{_ as a}from"./chunks/add_watch_icon.CHTvBBOZ.js";import{_ as m}from"./chunks/mql5storage_update_icon.BBTmqgY4.js";import{_ as c}from"./chunks/open_icon.zvFzltxF.js";import{_ as n,c as d,ag as _,o as h}from"./chunks/framework.CCnnzLsu.js";const f="/metaeditor/toolbox_errors.png",b="/metaeditor/toolbox_search.png",u="/metaeditor/toolbox_find_in_files.png",g="/metaeditor/toolbox_debug.png",w="/metaeditor/unknown_identifier_icon.png",k="/metaeditor/toolbox_articles.png",M="/metaeditor/article_view_icon.png",x="/metaeditor/toolbox_codebase.png",q="/metaeditor/download_icon.png",L="/metaeditor/ea_icon.png",Q="/metaeditor/indicator_icon.png",v="/metaeditor/script_icon.png",P="/metaeditor/library_icon.png",E="/metaeditor/toolbox_projects.png",j="/metaeditor/project_public_join_icon.png",T="/metaeditor/toolbox_journal.png",S="/metaeditor/journal_info_icon.png",z="/metaeditor/journal_warning_icon.png",A="/metaeditor/journal_error_icon.png",K=JSON.parse('{"title":"工具箱","description":"","frontmatter":{"head":[["link",{"rel":"canonical","href":"https://vite.dev/metaeditor/workspace/toolbox"}],["meta",{"property":"og:title","content":"工具箱"}]]},"headers":[],"relativePath":"metaeditor/workspace/toolbox.md","filePath":"metaeditor/workspace/toolbox.md","lastUpdated":1744293048000}'),I={name:"metaeditor/workspace/toolbox.md"};function N(O,e,V,$,y,C){return h(),d("div",null,e[0]||(e[0]=[_('<h1 id="工具箱" tabindex="-1">工具箱 <a class="header-anchor" href="#工具箱" aria-label="Permalink to &quot;工具箱&quot;">​</a></h1><p>工具箱是一个多功能窗口。 它显示 MetaEditor 中各种操作的执行结果: <a href="/metaeditor/workspace/toolbox#errors">编译</a>, <a href="/metaeditor/workspace/toolbox#search">搜索</a>, <a href="/metaeditor/workspace/toolbox#profile">分析</a> 和 <a href="/metaeditor/workspace/toolbox#debug">调试</a>。 此外，它提供了访问广泛的 <a href="/metaeditor/workspace/toolbox#codebase">源代码库</a> 和 <a href="/metaeditor/workspace/toolbox#articles">有关 MQL4/MQL5 编程的文章</a>。</p><p>而 <a href="/metaeditor/workspace/toolbox#journal">日志</a> 选卡反馈在 MetaEditor 中执行的操作, 例如, 在 MQL5 存储操作期间执行的那些操作。</p><p>您可以显示或隐藏此窗口，使用<img src="'+r+'" alt="工具箱"> 在 <a href="/metaeditor/main_menu/main_menu_view#toolbox">视图</a> 窗口或在 <a href="/metaeditor/toolbar/toolbar_standard#toolbox">标准</a> 工具栏里的工具箱命令来显示/隐藏窗口。</p><h2 id="errors" tabindex="-1">错误 <a class="header-anchor" href="#errors" aria-label="Permalink to &quot;错误{#errors}&quot;">​</a></h2><p>选卡显示程序 <a href="/metaeditor/development/compile">编译</a> 日志: 应用文件数据, 错误和警告。</p><p><img src="'+f+'" alt="错误"></p><p>该日志包含以下数据:</p><ul><li>描述 ― 事件描述。图标示意一种事件类型: <img src="'+o+'" alt="错误">― 错误,<img src="'+i+'" alt="警告">― 警告,<img src="'+l+'" alt="信息">― 信息消息。</li><li>文件 ― 所处理的文件名。 当鼠标光标悬停时，会出现一个完整文件路径的工具提示。</li><li>行 ― 包含错误或警告的行号。</li><li>列 ― 包含错误或警告的列号。</li></ul><p>双击一条错误消息，来打开相应的文件。 光标立即设置到出错位置。 所执行的操作类似<img src="'+t+'" alt="跳转到行">在关联菜单中跳转到行命令。</p><h2 id="search" tabindex="-1">搜索 <a class="header-anchor" href="#search" aria-label="Permalink to &quot;搜索{#search}&quot;">​</a></h2><p>在此选卡里显示 <a href="/metaeditor/development/source_code_find">在多文件里搜索</a> 和 <a href="/metaeditor/toolbar/toolbar_search">MQL5 社区</a> 的结果。</p><p>MetaEditor 提供的智能且高性能搜索功能依靠 <a href="https://www.mql5.com" title="MQL5 社区" target="_blank" rel="noreferrer">MQL5 社区</a> ― 交易员和 MQL4/MQL5 开发人员的社区。 该网站包含各种有用的信息: <a href="https://www.mql5.com/zh/docs" title="MQL5 社区文档" target="_blank" rel="noreferrer">文档</a>, <a href="https://www.mql5.com/zh/forum" title="MQL5 社区论坛" target="_blank" rel="noreferrer">论坛</a>, <a href="https://www.mql5.com/zh/blogs" title="交易员和分析师在 MQL5 社区的博客" target="_blank" rel="noreferrer">交易员和分析师的</a> 博客，<a href="https://www.mql5.com/zh/articles" title="MQL5 社区文章" target="_blank" rel="noreferrer">与编程和平台使用有关</a> 的文章。 社区提供海量 <a href="/metaeditor/workspace/toolbox#codebase" title="MQL5 社区代码库">源代码库的访问</a> 和 <a href="https://www.mql5.com/zh/market" title="在 MQL5 社区上的交易平台应用程序商店" target="_blank" rel="noreferrer">用于交易平台的</a>应用程序商店。</p><p>除了MQL5.community，搜索还包括其他受欢迎的平台，例如GitHub、MSDN和Stack Overflow。</p><p>使用 <a href="/metaeditor/toolbar/toolbar_search">工具栏</a> 以及在 <a href="/metaeditor/main_menu/main_menu_search">帮助菜单</a> 里的在线搜索命令执行搜索。 搜索结果可方便地按类别显示:</p><p><img src="'+b+'" alt="搜索"></p><p>要将最新发布显示在列表顶部，请在类别右侧启用“按日期排序”选项。</p><p>使用 <a href="/metaeditor/toolbar/toolbar_search">工具栏</a> 以及在 <a href="/metaeditor/main_menu/main_menu_search">搜索菜单</a> 里的 &quot;查找...&quot; 命令执行搜索。 结果以如下形式显示:</p><ul><li>文件 ― 完整文件路径，如果文件内含匹配搜索查询的行。</li><li>行 ― 文件内发现必要短语的行号。</li><li>文本 ― 发现的文本。 此处显示所发现短语的整个结构。</li></ul><p><img src="'+u+'" alt="在文件中的搜索结果"></p><p>若要跳转到发现的文本，请双击文件名。 所执行的操作类似<img src="'+t+'" alt="跳转到行">在关联菜单中跳转到行命令。</p><h2 id="profile" tabindex="-1">分析工具 <a class="header-anchor" href="#profile" aria-label="Permalink to &quot;分析工具{#profile}&quot;">​</a></h2><p>此选项卡显示 <a href="/metaeditor/development/profiling">分析</a> 程序源代码的结果。 分析允许您通过检测程序中最慢的片段来优化源代码。</p><p><img src="'+p+'" alt="Profiler"></p><p>函数名称</p><p>分析过程中执行函数调用的次数</p><p>函数执行花费的时间: 以毫秒为单位，占用全部函数总执行时间的百分比</p><p>关联菜单:</p><ul><li>打开 ― 移到源代码文件中的一行或一个函数。 同样的操作可以通过双击或按回车来完成。</li><li>全部展开 ― 展开所有折叠的函数。</li><li>全部折叠 ― 折叠所有展开的函数。</li><li>按行数排列函数 ― 切换分析结果 <a href="/metaeditor/development/profiling#lines">按行数查看。</a></li><li>按调用次数数排列函数 ― 切换分析结果 <a href="/metaeditor/development/profiling#calls">按调用次数查看。</a></li><li>导出 ― 分析结果导出为 Open XML (MS Office Excel), HTML (Internet Explorer) 或 CSV (文本文件)。</li><li>自动排列 ― 启用/禁用字段的自动调整。 按 A 键可完成相同的操作。</li><li>网格 ― 显示/隐藏网格分隔域。 按 G 键也可以完成相同的操作。</li></ul><p>查找详细的分析说明在<a href="/metaeditor/development/profiling">独立的部分</a>。</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>开始分析之前，不会显示该选项卡，直到使用<img src="'+s+'" alt="开始分析"> 在 <a href="/metaeditor/main_menu/main_menu_debug">调试</a> 菜单或 <a href="/metaeditor/toolbar/toolbar_standard">标准</a> 工具栏里的开始分析。</p></div><h2 id="debug" tabindex="-1">调试 <a class="header-anchor" href="#debug" aria-label="Permalink to &quot;调试{#debug}&quot;">​</a></h2><p>仅当启动 <a href="/metaeditor/development/debug">进程</a> 时才会显示调试选卡。 该窗口分为两部分。 左侧显示 <a href="/metaeditor/development/debug#stack">调用堆栈</a>, 而右侧 ― <a href="/metaeditor/development/debug#watch">所观察表达式的值</a>:</p><p><img src="'+g+'" alt="调试"></p><p>调用堆栈</p><p>显示调用堆栈中的以下数据:</p><ul><li>文件 ― 调用该函数的文件名和路径。</li><li>函数 ― 当前程序单步执行的函数名称。</li><li>行 ― 程序执行停止的行号。</li></ul><p>如果没有单一断点启用，并且没有执行 <a href="/metaeditor/development/debug#step">单步调试</a> 命令, 则左侧部分保持为空。 关联菜单允许您显示和隐藏网格分隔域，并设置列大小自动调整。</p><p>观察表达式</p><p>调试窗口的右侧部分旨在调试期间 <a href="/metaeditor/development/debug#watch">观察表达式的数值</a>:</p><ul><li>表达式 ― 所跟踪表达式的名称。</li><li>值 ― 所跟踪表达式的值。</li><li>类型 ― 表达式类型。</li></ul><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>如果此时表达式的数值未定义或未计算，则相应的字段显示 &quot;未知标识符&quot;。 这些表达式的图标看起来像这样:<img src="'+w+'" alt="未知标识符"> 中的测试程序。</p></div><p>若要添加观察表达式，请在程序的源代码中选择它并单击<img src="'+a+'" alt="添加关注">在关联菜单中添加观察。 另外，可以通过选项卡的关联菜单添加观察表达式: 单击<img src="'+a+'" alt="添加">添加并指定表达式名称。</p><h2 id="articles" tabindex="-1">文章 <a class="header-anchor" href="#articles" aria-label="Permalink to &quot;文章{#articles}&quot;">​</a></h2><p>该选卡提供大量 <a href="https://www.mql5.com/zh/articles" target="_blank" rel="noreferrer">有关 MQL4/MQL5 编程文献</a> 的访问，它们发表在 <a href="https://www.mql5.com" title="MQL5 社区" target="_blank" rel="noreferrer">MQL5 社区</a> 网站。这些文献是创建应用程序的绝佳指南，因为它们涵盖了涉及算法交易的许多实际任务。 每周都有新文献发表。</p><p><img src="'+k+'" alt="文章"></p><p>所有文献可以按照主题方便地分类，例如交易，指标，智能交易系统，策略测试器等。 您可以通过关联菜单按类别为文献分类。 若要查看文献，请双击其名称或单击<img src="'+M+'" alt="视图">关联菜单中的查看。 文献将在单独的浏览器窗口中打开。</p><p>在阅读文献之前，您可以查看其简要说明。 为此，请将光标悬停在其名称上。</p><h2 id="codebase" tabindex="-1">代码库 <a class="header-anchor" href="#codebase" aria-label="Permalink to &quot;代码库{#codebase}&quot;">​</a></h2><p>该选项卡提供对 <a href="https://www.mql5.com/zh/code" target="_blank" rel="noreferrer">MQL4/MQL5 源代码库</a> 的访问。 代码库包含数以千计的交易机器人，指标和脚本。 学习现成程序的源代码有助于更好地理解程序设计的原则。 它们也可以作为自行开发的基础。</p><p><img src="'+x+'" alt="代码库"></p><p>每个程序都会显示名称，简述，评级（由 MQL5 社区用户定义）和发布日期。 若要在网站上查看有关该程序的详细信息，请双击该程序。 若要下载该程序，请单击<img src="'+q+'" alt="下载">在关联菜单中的下载。</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><ul><li>程序文件根据程序的类别下载到 /MQL4 或 /MQL5 目录的子文件夹中。 例如，所有 EA 都保存到 /MQL5/Experts（或 /MQL4/Experts）。</li><li>下载之后，MQL4/MQL5 程序会自动完成 <a href="/metaeditor/development/compile">编译</a>。</li></ul></div><p>所有程序分为几个类别，拥有相应的图标:</p><ul><li><img src="'+L+'" alt="EA交易">― 智能交易系统</li><li><img src="'+Q+'" alt="指标">― 指标</li><li><img src="'+v+'" alt="脚本">― 脚本</li><li><img src="'+P+'" alt="程序库">― 函数库</li></ul><p>使用关联菜单按类别排序程序。</p><h2 id="公开项目" tabindex="-1">公开项目 <a class="header-anchor" href="#公开项目" aria-label="Permalink to &quot;公开项目&quot;">​</a></h2><p>在 MQL5 存储上的每一个 <a href="/metaeditor/mql5storage/projects#shared">共享项目</a> 均有公开设置: 项目可以是私人的或对其他用户开放。 您可以加入在单独的 &quot;公共项目&quot; 选项卡中显示的所有项目:</p><p><img src="'+E+'" alt="公开项目"></p><p>每个项目都会显示标题，说明，作者姓名，更改次数（提交）和创建日期。</p><p>若要参与该项目，请单击<img src="'+j+'" alt="加入">加入。 之后，该项目将显示在 &quot;共享项目&quot; 部分。 然后点击<img src="'+m+'" alt="从存储更新"> 从项目的关联菜单中执行从存储更新，以便将其下载到您的计算机。 有关公共项目的详细信息，请参见 <a href="/metaeditor/mql5storage/projects#public">单独的部分</a>。</p><h2 id="journal" tabindex="-1">日志 <a class="header-anchor" href="#journal" aria-label="Permalink to &quot;日志{#journal}&quot;">​</a></h2><p>日志选卡为您反馈在 MetaEditor 中执行的操作，例如，有关 <a href="/metaeditor/mql5storage/">MQL5 存储</a> 的操作, 以及通知有关新的 MQL4/MQL5 语言或 MetaEditor 参考，等等。</p><p><img src="'+T+'" alt="日志"></p><p>日志显示以下信息:</p><ul><li>时间 ― 事件日期和时间。</li><li>来源 ― 事件类型: 存储（MQL5 存储），帮助（参考指南）等。</li><li>消息 ― 事件描述。</li></ul><p>所有事件分为三种类型，由相应的图标标记:</p><ul><li><img src="'+S+'" alt="信息">― 信息消息</li><li><img src="'+z+'" alt="警告">― 警告</li><li><img src="'+A+'" alt="错误">― 错误消息</li></ul><p>若跳要转到 MetaEditor 流水账文件（metaeditor.log），请单击<img src="'+c+'" alt="打开">在关联菜单中的打开。 运行此命令时，当前流水帐条目将保存在文件中。 流水账文件保存在交易平台的 /Logs 目录中。</p>',69)]))}const W=n(I,[["render",N]]);export{K as __pageData,W as default};
